    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT + 64 * col0 BETWEEN ( + col2 - col1 ) AND - col0 * 84 + + ( 10 );
  - name: tab2

outputs:
  - name: q5861.out
    data: |
      46	51	23
      64	77	40
      75	67	58
